import React from 'react'
import { Footer, Navbar, Signup } from '../../components/allComponents'
import "./SingupPage.css"

function SingupPage() {
  return (
    <>
    <Navbar />
    <Signup />
    <Footer />
    </>
  )
}

export default SingupPage
